package com.dgcye.consultaCheques.dtos;

public class EcargoDTO {
	int cidr;
	int item;
	int apart;
	String docu;
	int secu;
	int foja;
	String apynom;
	int escue;
	DistritoDTO dist;
	String cat;
	int cargo;
	
	
	
	
	public EcargoDTO() {
		super();
		// TODO Auto-generated constructor stub
	}
	public int getCidr() {
		return cidr;
	}
	public void setCidr(int cidr) {
		this.cidr = cidr;
	}
	public int getItem() {
		return item;
	}
	public void setItem(int item) {
		this.item = item;
	}
	public int getApart() {
		return apart;
	}
	public void setApart(int apart) {
		this.apart = apart;
	}
	public String getDocu() {
		return docu;
	}
	public void setDocu(String docu) {
		this.docu = docu;
	}
	public int getSecu() {
		return secu;
	}
	public void setSecu(int secu) {
		this.secu = secu;
	}
	public int getFoja() {
		return foja;
	}
	public void setFoja(int foja) {
		this.foja = foja;
	}
	public String getApynom() {
		return apynom;
	}
	public void setApynom(String apynom) {
		this.apynom = apynom;
	}
	public int getEscue() {
		return escue;
	}
	public void setEscue(int escue) {
		this.escue = escue;
	}
	public DistritoDTO getDist() {
		return dist;
	}
	public void setDist(DistritoDTO dist) {
		this.dist = dist;
	}
	public String getCat() {
		return cat;
	}
	public void setCat(String cat) {
		this.cat = cat;
	}
	public int getCargo() {
		return cargo;
	}
	public void setCargo(int cargo) {
		this.cargo = cargo;
	}
	
	
	

}
